script: |
  super -f text -I q4305.spq | sort > q4305.out

inputs:
  - name: q4305.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT + ( + + col1 ) / - - 16 * col1 + - col1 - + - 58 IS NULL;
  - name: tab2

outputs:
  - name: q4305.out
    data: |
      46	51	23
      64	77	40
      75	67	58
